import React from 'react';
import './index.css';
import Draggable from 'react-draggable';
import SideBar from './SideBar';
import Window from './Window';

function AppleWindow({ toggleTabs, setToggleTabs, matches, setMatches }) {
  return (
    <>
      {matches ? (
        <Draggable>
          <div className="apple-window-container">
            <SideBar toggleTabs={toggleTabs} setToggleTabs={setToggleTabs} />
            <Window
              matches={matches}
              setMatches
              toggleTabs={toggleTabs}
              setToggleTabs={setToggleTabs}
            />
          </div>
        </Draggable>
      ) : (
        <Window
          matches={matches}
          setMatches={setMatches}
          toggleTabs={toggleTabs}
          setToggleTabs={setToggleTabs}
        />
      )}
    </>
  );
}

export default AppleWindow;
